svg.script:
// automatically render to PNG
function drawAt(size) {
 let renderer = new OffscreenCanvas(size, size);
 let rendererContext = renderer.getContext("2d");
 let target = new Image();
 target.src = URL.createObjectURL(new Blob([document.rootElement.outerHTML], {type: "image/svg+xml"}));
 target.onload = () => {
  rendererContext.drawImage(target, 0, 0, renderer.width, renderer.height);
  renderer.convertToBlob().then(blob => {
   let link = document.createElementNS("http://www.w3.org/1999/xhtml", "a");
   link.href = URL.createObjectURL(blob);
   link.download = "icon" + (size / 16) + ".png";
   link.click()
  });
 };
}
function begin() {
 let scale = 4;
 drawAt(384 * scale);
 drawAt(288 * scale);
}
setTimeout(begin, 100);
